import '../css/main.css';
import '../css/navbar.css';
import Navbar from 'react-bootstrap/Navbar';
import Nav from 'react-bootstrap/Nav';

function HeaderNav() {
  return (
    <Navbar id="navbar-container" variant="dark" expand="sm">
      <Navbar.Toggle id="toggle"/>
      <Navbar.Collapse>
        <Nav>
          <Nav.Link>A</Nav.Link>
          <Nav.Link>B</Nav.Link>
          <Nav.Link>C</Nav.Link>
        </Nav>
      </Navbar.Collapse>
    </Navbar>
  );
}

export default HeaderNav;
